var MonnCalc = require('./mooncalc'),
  t = require('tape');



t.test('test data for day', function (t) {
  var date = new Date();
  date.setDate(8);
  t.equal(
    JSON.stringify(MoonCalc.datasForDay(date)),
    JSON.stringify({
      'day' : date,
      'latitude' : 48.8534100,
      'longitude' : 2.3488000,
      'date' : date
    })
  );

  t.end();
});